class.haxe_doc:
An array data structure that compactly stores individual bits (boolean values)

	Example:
		var o = new de.polygonal.ds.BitVector(40);
		for (i in 0...40) {
		    if (i & 1 == 0) {
		        o.set(i);
		    }
		}
		trace(o); //outputs:

		[ BitVector numBits=40
		  0 -> 01010101010101010101010101010101
		  1 -> 00000000000000000000000001010101
		]

An object that can be cloned by calling `object.clone()`

	Example:
		class Foo implements de.polygonal.ds.Cloneable<Foo> {
			public function new() {}
			public function clone():Foo {
				return new Foo();
			}
		}

Specifies that the order of an element in a collection can be determined by calling `object.compare(otherObject)`

	Example:
		class Element implements de.polygonal.ds.Comparable<Element> {
		    public var val:Int;
		    public function new() {}
		    public function compare(other:Element):Int {
		        return val - other.val;
		    }
		}

